import React from 'react';
import '../styles/App.css';

const ReviewsSlider = () => (
  <section className="reviews-slider">
    <div className="review">
      <p>"Excellent service!" - John</p>
    </div>
    <div className="review">
      <p>"Smooth move." - Jane</p>
    </div>
    <div className="review">
      <p>"Highly recommend." - Ravi</p>
    </div>
  </section>
);

export default ReviewsSlider;
